import React, {Component} from 'react';
import {Link} from 'react-router-dom';

class Header extends Component {
    render() {
        return (
            <>
                <div className="header-dashboard flex justify-between">
                    <div className="header-left">
                        <h3 className="text-gray-900 font-bold text-2xl text-left">Dashboard</h3>
                        <p className="text-gray-600 text-sm text-left">Everything here</p>
                    </div>

                    <div className="header-center relative max-w-xl flex-grow">
                        <form className="" method="get">
                            <input type="text" placeholder="Search something" className="w-full px-8 text-sm focus:outline-none h-12 border-b focus:border-yellow-400 text-gray-600" />
                            <button className="absolute left-0 transform translate-y-3">
                                <i className="fa fa-search" aria-hidden="true"></i>
                            </button>
                        </form>
                    </div>

                    <div className="header-right flex items-center">
                        <Link to="#" className="mr-4 text-sm font-semibold">VIEW YOUR STORE</Link>
                        <i className="fa fa-sign-out text-2xl" aria-hidden="true"></i>
                    </div>
                </div>
            </>
        )
    }
}

export default Header;
